import { Navigate } from "react-router-dom";
import Login from "./Login"

const ProtectedLogin = (props) => {
    const doAuth = (bool) => {
        props.setAuth(bool);
    }

    return !props.isAuth ? <Login doAuth={doAuth}/> : <Navigate to="/dashboard"/>;
}

export default ProtectedLogin;
